import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
function Home(){
  return (
    <h1>HomePage</h1>
  )
}
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/">
        <Route index element={<Home />} />
      </Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
